export default class Message{

    constructor(roomCode, message, userName, tkn, id) { 
        this.roomCode = roomCode;
        this.message = message;
        this.userName = userName;
        this.id = id;
        this.userToken = tkn;
        this.reactions = {}
        this.reactors = {}
    }

}
